            modelBuilder.Entity("DrawnFromSteel.Models.Static.Culture.Environment", b =>
                {
                    b.Property<int>("Id")
                        .ValueGeneratedOnAdd()
                        .HasColumnType("integer")
                        .HasColumnName("id");

                    NpgsqlPropertyBuilderExtensions.UseIdentityAlwaysColumn(b.Property<int>("Id"));

                    b.Property<string>("Description")
                        .IsRequired()
                        .HasColumnType("varchar(1000)")
                        .HasColumnName("description");

                    b.Property<string>("Name")
                        .IsRequired()
                        .HasColumnType("varchar(10)")
                        .HasColumnName("name");

                    b.Property<int>("SkillOptionId")
                        .HasColumnType("integer")
                        .HasColumnName("skill_option_id");

                    b.HasKey("Id")
                        .HasName("pk_environment");

                    b.HasIndex("SkillOptionId")
                        .HasDatabaseName("ix_environment_skill_option_id");

                    b.ToTable("environment", (string)null);

                    b.HasData(
                        new
                        {
                            Id = 1,
                            Description = "A nomadic culture travels from place to place to survive. They might follow animal migrations or the weather, travel to sell their wares or services, or simply enjoy a restless lifestyle full of new experiences and peoples. Those who grow up in nomadic cultures learn to navigate the wilderness and interact with others.",
                            Name = "Nomadic",
                            SkillOptionId = 1
                        },
                        new
                        {
                            Id = 2,
                            Description = "A rural culture is one located in a town, village, or smaller settled enclave. People dwelling in such places often cultivate the land, trade goods or services with travelers passing through, harvest fish from the sea, or mine metals and gems from the earth.Living among a small population, most folks in a rural community learn a trade and are handed down bits of essential knowledge to help their community survive. For example, when a rural culture has only one blacksmith, it’s important to have an apprentice already learning at the anvil well before that smith starts to get old. If the only priest in town gets the sniffles, folks want an acolyte ready to wear the fancy robes should the worst occur.",
                            Name = "Rural",
                            SkillOptionId = 2
                        },
                        new
                        {
                            Id = 3,
                            Description = "A secluded culture is based in one relatively close-quarters structure—a building, a cavern, and so forth—and interacts with other cultures only rarely. Such places are often buildings or complexes such as monasteries, castles, or prisons. Folk in a secluded culture have little or no reason to leave their home or interact with other cultures on the outside, but might have an awareness of those cultures and of events happening outside their enclave. When people live together in close quarters, they typically learn to get along. They often spend much time in study or introspection, as there is not much else to do in seclusion.",
                            Name = "Secluded",
                            SkillOptionId = 3
                        },
                        new
                        {
                            Id = 4,
                            Description = "An urban culture is always centered in a city. Such a culture might arise within the walls of Capital, a massive metropolis with a cosmopolitan population; within a network of caverns that hold an underground city; or in any other place where a large population lives relatively close together. The people of urban cultures often learn to effectively misdirect others in order to navigate the crowds and the political machinations that can come with city life.",
                            Name = "Urban",
                            SkillOptionId = 4
                        },
                        new
                        {
                            Id = 5,
                            Description = "A wilderness culture doesn’t attempt to tame the terrain in which its people live, whether desert, forest, swamp, tundra, ocean, or more exotic climes. Instead, the folk of such a culture thrive amid nature, taking their sustenance and shelter from the land itself. A wilderness culture might be a circle of druids protecting a great wode, a band of brigands hiding out in desert caves, or a camp of orc mercenaries who call the trackless mountains home. People in a wilderness culture learn how to use the land for all they need to live, typically crafting their own tools, clothing, and more.",
                            Name = "Wilderness",
                            SkillOptionId = 5
                        });
                });

