                    b.HasData(
                        new
                        {
                            Id = 1,
                            Description = "Might (M) represents strength and brawn. A creature’s ability to break down doors, swing an axe, stand up during an earthquake, or hurl an ally across a chasm is determined by Might.",
                            Name = "Might",
                            Short = 'M'
                        },
                        new
                        {
                            Id = 2,
                            Description = "Agility (A) represents coordination and nimbleness. A creature’s ability to backflip out of danger, shoot a crossbow, dodge an explosion, or pluck keys from a guard’s belt is determined by Agility.",
                            Name = "Agility",
                            Short = 'A'
                        },
                        new
                        {
                            Id = 3,
                            Description = "Reason (R) represents a logical mind and education. A creature’s ability to solve a puzzle that unlocks a door, recall lore about necromancy, decipher a coded message, or blast a foe with psionic power is determined by Reason.",
                            Name = "Reason",
                            Short = 'R'
                        },
                        new
                        {
                            Id = 4,
                            Description = "Intuition (I) represents instincts and experience. A creature’s ability to recognize a faint sound as the approach of a distant rider, quickly read the tell of a bluffing gambler, calm a rearing horse, or track a monster across the tundra is determined by Intuition.",
                            Name = "Intuition",
                            Short = 'I'
                        },
                        new
                        {
                            Id = 5,
