                            Id = 1,
                            Description = "The 1st echelon of play encompasses levels 1 to 3. At this echelon, the player characters are local heroes. They save lost caravans, besieged villages, and overlooked neighborhood s of cities. The heroes battle bands of mortal humanoids —dwarves, elves, goblins, humans, kobolds, orcs. They face the occasional larger monstrous threat, such as a bredbeddle, ogre, or chimera. These are the kinds of creatures that can threaten a small community, but rarely have plans for world domination or the destruction of the timescape.However, the adversaries might work for or be manipulated by a stronger threat as a foreshadowing of what awaits the hero at higher echelons.",
                            Echelon = 1
                        },
                        new
                        {
                            Id = 2,
                            Description = "The 2nd echelon of play encompasses levels 4 to 6. At this echelon, heroes are now known throughout wider region they serve. In Vasloria, this mean s that they’re saving and celebrated by an entire country. In Capital, their reputation and work now encompasses several different neighborhoods of the enormous city. Heroes of the timescape might be known for saving a planet! Heroes in this echelon battle humanoids of great supernatural power, such as draconians, devils, and hobgoblin s . The bosses they face possess cunning and ambition as great as their terrible power, such as medusas and overminds. Heroes are this level also face the humanoid threats of earlier levels, but these foes are their villainous counterparts of equal power instead of bands of ruffians or marauding armies.",
