                            Name = "Conduit"
                        },
                        new
                        {
                            Id = 3,
                            Description = "An elementalist studies the elemental forces of the timescape and controls earth, fire, the void, and more with magic. Many of their abilities cover wide areas of the map and they have a versatile array of tricks that allow them to control the battlefield and accomplish tasks outside of combat.",
